import { Navigate, PartialRouteObject } from "react-router-dom";
import { CreatePetBreedsPage } from "./CreatePetBreedsPage";
import { PetBreedsPage } from "./PetBreedsPage";
import { UpdatePetBreedsPage } from "./UpdatePetBreedsPage";

export const PetBreedRoutes: PartialRouteObject[] = [
  { path: "", element: <Navigate to="/pet-breeds/list" /> },
  { path: "list", element: <PetBreedsPage /> },
  { path: "create", element: <CreatePetBreedsPage /> },
  { path: "update/:id", element: <UpdatePetBreedsPage /> },
];
